import React from 'react'
import product from '../products'
import {Row,Col} from 'react-bootstrap'
import Products from '../Components/Products'

const HomeScreen = () => {
    return (
        <>
        <Row>
                {product.map( el=>(
                    <Col key sm={12} md={6} lg={4} xl={3}>
                        <Products product={el}/>
                    </Col>
                ))}
        </Row>
        </>
    )
}

export default HomeScreen
